import React from 'react';
const listTemplate = () => {
    return (
        <div className="list-item template-list-item" todo-id="" >
            <input type="checkbox" todo-type="check" className="check-box"></input>
            <p todo-type="text-holder"></p>
            <button class="buttonClass-done"  todo-type="btn-done"  style="color: rgb(0, 139, 139);">Done</button>
            <button class="buttonClass-x" todo-type = "btn-x" style="color: rgb(255, 81, 81);">X</button>
        </div>
        );

}

export default listTemplate;
